<li>{number}</li>
);

export default function ListSanPham() {
    console.log(data[0]);   
    
    return (
        <div className="row">
            <SanPham name={data[0]["name"]} price = {data[0]["price"]} detail = {data[0]["detail"]}></SanPham>
            listItems
        </div>
    )
}
